Quais são os assuntos da prova do concur:
De acordo com o texto, os assuntos da prova do concurso da CNEN são:

* Características;
* Razões da dicotomia procedimental;
* Procedimentos especiais e ações nominadas;
* Trânsito de técnicas processuais adequadas entre os procedimentos especiais e entre esses e o procedimento comum;
* Princípios e regras que distinguem os procedimentos especiais de jurisdição contenciosa dos procedimentos especiais de jurisdição voluntária;
* Cumulação de pedidos;
* Princípios dispositivo e da congruência;
* Princípios da mutabilidade/imutabilidade objetiva e subjetiva do processo;
* Princípio da estabilização do processo;
* Procedimentos especiais de jurisdição contenciosa regulados no Código de Processo Civil, incluindo:
	+ Ação de consignação em pagamento;
	+ Ação de exigir contas;
	+ Ações possessórias (manutenção/reintegração de posse/interdito proibitório, distinção, cumulação de pedidos, fungibilidade e a problemática do confronto entre ações petitórias e possessórias);
	+ Embargos de terceiro;
	+ Oposição;
	+ Habilitação;
	+ Ações de família na competência da justiça federal;
	+ Ação monitória;
	+ Ação de restauração de autos.
